class HelloWorld {

    getInfo(icon) {
        return {
            blocks: [
                {
                    opcode: 'hello',
                    blockType: Scratch.BlockType.REPORTER,
                    text: 'Hello!'
                },

                {
                    opcode: 'random',
                    blockType: Scratch.BlockType.BOOLEAN,
                    text: 'True Or False'
                }
            ],

            color1: "#fff200",
            color2: "#1f1d00",
            color3: "#8c8a00",
            const: icon =
                "data:image/png;base64,",
            id: 'helloworld',
            menuIconURI: icon,
            name: 'OMORChips'
        };
    }

    hello() {
        return 'World!';
    }

    random() {
        return Math.random() < 0.5;
    }
}

Scratch.extensions.register(new HelloWorld());